import './App.css';

function App() {
  return (
    <div>
      <Nav />
      <Routes>
        <Route path="" element={<Data />} />
        <Route path="/about" element={<About />} />
        <Route path="/users" element={<User />} />
        <Route path="/news" element={<News />} />
        <Route path='*' element={<Error />} />
      </Routes>
    </div>
  );
}

export default App;
